import './Home.css';
import CardData from './CardData'

const Services = () => {
    const CardData = (val) =>{
        return(
            <div className="user">{val.user}</div>
        )
    }
  return (
      <>
       {User.map(CardData)}
      </>
  )
};

export default Services;
